import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import './App.css';
import { Container, Row, Col } from 'react-bootstrap';
import Header from './components/header/header.jsx';
import Main_wrapper from './components/main-wrapper/Mainwrap';
import Coment from './components/comment/coment';
import { Route, BrowserRouter } from 'react-router-dom';
const App = (props) => {
  return (
    <>
      <BrowserRouter>
        <Header />
        <Route path={"/main-wrapper"} render={ () => <Main_wrapper Posts={props.state.Posts} newPost={props.newPostText} addPost={props.addPost}/>} />
        <Route path={"/coment"} render={ () => <Coment DialogsData={props.state.DialogsData}/>} />
      </BrowserRouter>
    </>
  );
}


export default App;
